          <Route exact path="/portfolio" component={Portfolio}/>
          <Route exact path="/portfolio/add" component={AddPortfolio}/>
          <Route exact path="/portfolio/edit/:SN" component={EditPortfolio}/>
        </Switch> 
      </div>
    </Router>
  );
}


export default App;
